<div id="banner"><div class="container intro_wrapper"><div class="inner_content"><h2>Clientes Satisfeto</h2><h1 class="title">Obras Realizadas</h1><h3 class="intro">Quando resolvemos instalar <span class="hue">portões automáticos</span> para a garagem de nossa residência, minha esposa e eu tinhamos a preocupação quanto à <span>qualidade do equipamento</span>, ruídos durante o uso, estética e <span>velocidade de abertura</span> e fechamento que desse segurança a nossa Família.</h3></div></div></div><div class="container wrapper"><div class="inner_content"><div id="options"><ul id="filters" class="option-set" data-option-key="filter"><li><a href="#filter" data-option-value="*" class="selected">Todos</a></li><li><a href="#filter" data-option-value=".comDepoimento">Com Depoimento</a></li><li><a href="#filter" data-option-value=".semDepoimento">Sem Depoimento</a></li><li><a href="#filter" data-option-value=".portaoAluminio">Portão de Alumínio</a></li></ul><div class="clear"></div></div><div class="row"><div class="projects"><div class="span3 element portaoAluminio" data-category="portaoAluminio"><div class="hover_img"><a href="img/portao-aluminio/obras/portao-aluminio-qualitydoors-001.jpg" data-rel="prettyPhoto[aluminio01]" title="Portões de Alumínio"><img src="img/portao-aluminio/obras/portao-aluminio-qualitydoors-001.jpg" alt="Portões de Alumínio" title="Portões de Alumínio"></a></div></div><div class="span3 element portaoAluminio" data-category="portaoAluminio"><div class="hover_img"><a href="img/portao-aluminio/obras/portao-aluminio-qualitydoors-002.jpg" data-rel="prettyPhoto[aluminio02]" title="Portões de Alumínio"><img src="img/portao-aluminio/obras/portao-aluminio-qualitydoors-002.jpg" alt="Portões de Alumínio" title="Portões de Alumínio"></a></div></div><div class="span3 element portaoAluminio" data-category="portaoAluminio"><div class="hover_img"><a href="img/portao-aluminio/obras/portao-aluminio-qualitydoors-003.jpg" data-rel="prettyPhoto[aluminio03]" title="Portões de Alumínio"><img src="img/portao-aluminio/obras/portao-aluminio-qualitydoors-003.jpg" alt="Portões de Alumínio" title="Portões de Alumínio"></a></div></div><div class="span3 element portaoAluminio" data-category="portaoAluminio"><div class="hover_img"><a href="img/portao-aluminio/obras/portao-aluminio-qualitydoors-004.jpg" data-rel="prettyPhoto[aluminio04]" title="Portões de Alumínio"><img src="img/portao-aluminio/obras/portao-aluminio-qualitydoors-004.jpg" alt="Portões de Alumínio" title="Portões de Alumínio"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/portao-seccional/portao-seccionado-textura-michelangelo-007.jpg" data-rel="prettyPhoto[qdc066]" title="Portão Seccionado Michelangelo"></a> <a href="img/portao-seccional/portao-seccional-textura-michelangelo-007.jpg" data-rel="prettyPhoto[qdc066]" title="Portão Seccionado Michelangelo"><img src="img/portao-seccional/portao-seccional-textura-michelangelo-007.jpg" title="Portão Seccionado Michelangelo" alt="Portão Seccionado"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/portao-seccional/portao-seccional-textura-botticelli-004.jpg" data-rel="prettyPhoto[qdc065]" title="Portão Seccionado São Paulo"><img src="img/portao-seccional/portao-seccional-textura-botticelli-004.jpg" title="Portão Seccionado São Paulo" alt="Portão Seccionado São Paulo"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/portao-seccional/portao-seccional-textura-botticelli-005.jpg" data-rel="prettyPhoto[qdc064]" title="Portão Seccionado São Paulo"><img src="img/portao-seccional/portao-seccional-textura-botticelli-005.jpg" title="Portão Seccionado São Paulo" alt="Portão Seccionado São Paulo"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc063-portao-automatico-zona-sul.jpg" data-rel="prettyPhoto[qdc063]" title="Portão Automático São Paulo"><img src="img/obras/qdc063-portao-automatico-zona-sul.jpg" title="Portão Automático São Paulo" alt="Portão Automático São Paulo"></a></div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc062-portao-automatico-arquiteto-basculante--sao-paulo.jpg" data-rel="prettyPhoto[qdc062]" title="Portões Automáticos São Paulo"><img src="img/obras/qdc062-portao-automatico-arquiteto-basculante--sao-paulo.jpg" title="Portões Automáticos São Paulo" alt="Portões Automáticos São Paulo"></a></div><div class="item_description"><a href="javascript:{}"><span>ARQUITETO CARLOS HENRIQUE</span></a><br>Fiquei muito satisfeito com a Quality Doors, desde o primeiro atendimento, medição no local, prazo de entrega, até chegar no produto final, que me surpreendeu positivamente com a qualidade. Vou recomendar sempre para os meus clientes.</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc061-portao-automatico-basculante--sao-paulo.jpg" data-rel="prettyPhoto[qdc061]" title="Portões Automáticos São Paulo"><img src="img/obras/qdc061-portao-automatico-basculante--sao-paulo.jpg" alt="Portões Automáticos São Paulo" title="Portões Automáticos São Paulo"></a></div><div class="item_description"><a href="javascript:{}"><span>CLEUSA H. Y. TANAKA.</span></a><br>É com satisfação podermos manifestar sobre o bom atendimento e a qualidade do produto que adquirimos de sua empresa. Sem dúvida nenhuma, o combinado foi rigorosamente seguido por V.Sas., com total satisfação de nossa parte. Não tivemos nenhuma ocorrência que levasse à qualquer preocupação e transcorreu, da contratação até a instalação e pintura, de forma muito elogiável. Agradecemos a todos da sua empresa.</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc060-portao-automatico-basculante--sao-paulo.jpg" data-rel="prettyPhoto[qdc060]" title="Portões Automáticos São Paulo"><img src="img/obras/qdc060-portao-automatico-basculante--sao-paulo.jpg" alt="Portões Automáticos São Paulo" title="Portões Automáticos São Paulo"></a></div><div class="item_description"><a href="javascript:{}"><span>JOÃO DE ALMEIDA</span></a><br>Estávamos em busca de uma empresa para instalação de um portão automático em um dos nossos imóveis. Encontramos a Quality Doors, fomos muito bem atendidos desde o primeiro contato e posteriormente através do Gerente Comercial que fez a apresentação do produto, com todas as nossas dúvidas esclarecidas. Fechamos a compra com boas condições de pagamento. A Quality Doors cumpriu o prazo de instalação com pessoas qualificadas para a montagem do portão de excelente qualidade. Estamos satisfeitos com o portão instalado que trouxe mais beleza e segurança ao local. Recomendamos a Quality Doors, uma empresa séria.</div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc059-portao-automatico-basculante--sao-paulo.jpg" data-rel="prettyPhoto[qdc059]" title="Portões Automáticos São Paulo"><img src="img/obras/qdc059-portao-automatico-basculante--sao-paulo.jpg" alt="Portão Automático São Paulo" title="Portões Automáticos São Paulo"></a></div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc058-portao-automatico-basculante-arquiteto-sao-paulo.jpg" data-rel="prettyPhoto[qdc058]" title="Portões Automáticos São Paulo"><img src="img/obras/qdc058-portao-automatico-basculante-arquiteto-sao-paulo.jpg" alt="Portões Automáticos São Paulo" title="Portões Automáticos São Paulo"></a></div><div class="item_description"><a href="javascript:{}"><span>ARQUITETO FELIPE RADUAN</span></a><br>Excelente atendimento desde o primeiro contato até a entrega do produto, que foi realizada antes do prazo combinado, além da ótima qualidade e acabamento do portão basculante entregue para a minha residência. Recomendo muito a Quality Doors, inclusive estou utilizando a empresa em outros projetos dentro do meu escritório</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc057-portao-automatico-zona-sul-sao-paulo.jpg" data-rel="prettyPhoto[qdc057]" title="Portões Automáticos São Paulo"><img src="img/obras/qdc057-portao-automatico-zona-sul-sao-paulo.jpg" alt="Portões Automáticos São Paulo" title="Portões Automáticos São Paulo"></a></div><div class="item_description"><a href="javascript:{}"><span>ELIAZETE DE SOUZA</span></a><br>Tivemos a escolha certa na hora de efetuarmos a troca de nosso portão. A Quality Doors foi extremamente competente em todos os aspectos do serviço, desde o processo de vendas até o processo de montagem. Estamos extremamente satisfeitos com o resultado.</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc056-portao-automatico-zona-sul.jpg" data-rel="prettyPhoto[qdc056]" title="Portões Automáticos São Paulo"><img src="img/obras/qdc056-portao-automatico-zona-sul.jpg" alt="Portão Automático São Paulo" title="Portões Automáticos São Paulo"></a></div><div class="item_description"><a href="javascript:{}"><span>CARLOS PURIM</span></a><br>Tendo adquirido o portão de nossa residência nesta empresa, Quality Doors, ficamos muito satisfeito com a compra desde a disposição do vendedor, no atendimento, os prazos estipulados e a colocação do mesmo correu tudo bem, foi uma excelente aquisição.<br>Quero agradecer o empenho que me deram para realizar esta compra.<br>Muito obrigado</div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc055-portoes-automaticos-zona-sul.jpg" data-rel="prettyPhoto[qdc055]" title="Portões Automáticos São Paulo"><img src="img/obras/qdc055-portoes-automaticos-zona-sul.jpg" alt="Portão Automático São Paulo" title="Portões Automáticos São Paulo"></a></div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc053-portoes-automaticos-sp-sao-paulo-zona-sul.jpg" data-rel="prettyPhoto[qdc053]" title="Portões Automáticos"><img src="img/obras/qdc053-portoes-automaticos-sp-sao-paulo-zona-sul.jpg" alt="Portão Automático São Paulo" title="Portões Automáticos"></a></div><div class="item_description"><a href="javascript:{}"><span>ARTHUR FARIA</span></a><br>Estou extremamente satisfeito com os produtos da empresa. Desde o primeiro contato até a instalação fui muito bem atendido. Todos são muito profissionais. Certamente voltaria a fazer negócio com a QualityDoors</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc054-portoes-automaticos-sp-ipiranga.jpg" data-rel="prettyPhoto[qdc0542]" title="Portões Automáticos"><img src="img/obras/qdc054-portoes-automaticos-sp-ipiranga.jpg" alt="Portão Automático São Paulo" title="Portões Automáticos"></a></div><div class="item_description"><a href="javascript:{}"><span>JOSÉ C. C. DE SOUSA</span></a><br>Desde o primeiro dia fiquei agradavelmente surpreendido, o Marcelo foi de um profissionalismo que me deixou muito surpreso.<br>Conseguiu não só atender o meu pedido inicial, mas vender outros produtos pelo seu profissionalismo.<br>Fui acompanhado durante todo o processo de preparação por uma equipe técnica excelente, que veio diversas vezes à obra verificar o andamento e as medidas, o que fez com que no dia da instalação os portões antigos fossem retirados e os novos entrassem no lugar sem qualuqer tipo de incidente.<br>Todos os acessóriso como video porteiro e cameras foram instalados, quando foi possivel, todo o funcionamento dos aparelhos foi devidamente explicado e ficou tudo a funcionar perfeitamente.<br><br>Já recomendei e voltarei a recomendar a todos os interessados, uma empresa séria e comprometida com o cliente, eu gostaria de ter todos os fornecedores como esta empresa.</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc052-portoes-automaticos-sp-sao-paulo-capital.jpg" data-rel="prettyPhoto[qdc052]" title="Portão Automático"><img src="img/obras/qdc052-portoes-automaticos-sp-sao-paulo-capital.jpg" alt="Portão Automático São Paulo" title="Portões Automáticos"></a></div><div class="item_description"><a href="javascript:{}"><span>WAGNER</span></a><br>Sou sindico do Condomínio Be Happy, quando assumi o cargo troquei o prestador de serviço mas continuamos com os mesmos problemas, iniciamos uma busca no mercado, onde não bastaria ter o melhor preço e sim entender o problema para resolve-lo da melhor forma. Com dedicação e profissionalismo a equipe Quality Doors nos apresentaram um projeto com equipamentos e funcionalidades especifica para o porte do condomínio. Estamos satisfeitos e com maior prazer presto este depoimento. Parabéns a empresa!!!</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc048-portao-automatico-alberto-sp-sao-paulo.jpg" data-rel="prettyPhoto[qdc048]" title="Portão Automático"><img src="img/obras/qdc048-portao-automatico-alberto-sp-sao-paulo.jpg" alt="Portão Automático São Paulo" title="Portão Automático"></a></div><div class="item_description"><a href="javascript:{}"><span>ALBERTO TEBALDI</span></a><br>Aqui em casa todos gostaram do serviço prestado por vocês. Mas o que me agradou muito foi o atendimento dos funcionários, todos foram muito educados. Recomendo a todos que precisarem do serviço deles. Obrigado</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc047-portao-automatico-antonio-sp-sao-paulo.jpg" data-rel="prettyPhoto[qdc047]" title="Portão Automático"><img src="img/obras/qdc047-portao-automatico-antonio-sp-sao-paulo.jpg" alt="Portão Automático São Paulo" title="Portão Automático"></a></div><div class="item_description"><a href="javascript:{}"><span>ANTONIO C.CORREA</span></a><br>Gostaríamos de participar de vosso portal , mostrando a todos o excelente trabalho realizado pela Quality Doors, tanto na aquisição do produto como tambem na execução prazo e instalação, destacando porem a modernização , um produto novo, sistema mais silencioso rápido , que otimiza espaço em sua instalação, Uma perfeita execução na pintura e ​ calafetação de minha unidade, Agradeço a toda equipe por este feito. Muito Obrigado.</div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc046-portao-automatico-sp-sao-paulo.jpg" data-rel="prettyPhoto[qdc046]" title="Portão Automático"><img src="img/obras/qdc046-portao-automatico-sp-sao-paulo.jpg" alt="Portão Automático São Paulo" title="Portão Automático"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc045-portao-automatico-sp-sao-paulo.jpg" data-rel="prettyPhoto[qdc045]" title="Portão Automático"><img src="img/obras/qdc045-portao-automatico-sp-sao-paulo.jpg" alt="Portão Automático São Paulo" title="Portão Automático"></a></div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc044-portao-automatico-sp-sao-paulo.jpg" data-rel="prettyPhoto[qdc044]" title="Portão Automático"><img src="img/obras/qdc044-portao-automatico-sp-sao-paulo.jpg" alt="Portão Automático São Paulo" title="Portão Automático"></a></div><div class="item_description"><a href="javascript:{}"><span>MARCIO CARLETTI</span></a><br>Ótimo produto, ótimo atendimento de instalação do produto</div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc043-portao-automatico-sp-sao-paulo.jpg" data-rel="prettyPhoto[qdc043]" title="Portão Automático"><img src="img/obras/qdc043-portao-automatico-sp-sao-paulo.jpg" alt="Portão Automático São Paulo" title="Portão Automático"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc042-portao-automatico-sp-sao-paulo.jpg" data-rel="prettyPhoto[qdc042]" title="Portão Automático"><img src="img/obras/qdc042-portao-automatico-sp-sao-paulo.jpg" alt="Portão Automático São Paulo" title="Portão Automático"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc041-portao-automatico-sp-sao-paulo.jpg" data-rel="prettyPhoto[qdc041]" title="Portão Automático"><img src="img/obras/qdc041-portao-automatico-sp-sao-paulo.jpg" alt="Portão Automático São Paulo" title="Portão Automático"></a></div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc040-portao-automatico-sp-sao-paulo.jpg" data-rel="prettyPhoto[qdc040]" title="Modelo de Portões Automático"><img src="img/obras/qdc040-portao-automatico-sp-sao-paulo.jpg" alt="Portão Automático São Paulo" title="Portão Automático"></a></div><div class="item_description"><a href="javascript:{}"><span>CLÉLIA</span></a><br>Fiquei muito satisfeita com o atendimento da "Quality Doors". Desde o primeiro contato, até a assistência técnica, só tenho elogios. O portão ficou bem mais leve, mais rápido e mais bonito. Esta empresa é uma boa representante da qualidade "Porta Toldos" que já conhecia há 25 anos.Recomendo!</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc039-portao-automatico-sp-sao-paulo.jpg" data-rel="prettyPhoto[qdc039]" title="Modelo de Portões Automático"><img src="img/obras/qdc039-portao-automatico-sp-sao-paulo.jpg" alt="Portão Automático Basculante" title="Modelo de Portões Automático"></a></div><div class="item_description"><a href="javascript:{}"><span>APARECIDA DIMBERIO</span></a><br>O atendimento da Quality Doors foi muito bom e quanto ao produto, o portão slimtech não deixou a desejar: é prático, funcional e superou as minhas expectativas.</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc037b-portao-automatico-sp-sao-paulo.jpg" data-rel="prettyPhoto[qdc037]" title="Modelo de Portões Automático"><img src="img/obras/qdc037b-portao-automatico-sp-sao-paulo.jpg" alt="Portão Automático São Paulo" title="Modelo de Portões Automático"> </a><a href="img/obras/qdc037-portao-automatico-sp-sao-paulo.jpg" data-rel="prettyPhoto[qdc037]" title="Modelo de Portões Automático"></a></div><div class="item_description"><a href="javascript:{}"><span>ADALBERTO DOS SANTOS</span></a><br>"Quando resolvemos instalar portões automáticos para a garagem de nossa residência, minha esposa e eu tinhamos a preocupação quanto à qualidade do equipamento, ruídos durante o uso, estética e velocidade de abertura e fechamento que desse segurança a nossa Família.<br>Felizmente encontramos a Quality Doors que além dos ítens mencionados nos atendeu com pontualidade e profissionalismo. Podemos dizer que esta empresa recomendamos a nossos amigos. "</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc023-portao-eletronico-social.jpg" data-rel="prettyPhoto[qdc023]" title="Portão Automático Basculante"></a> <a href="img/obras/qdc023-portao-basculante.jpg" data-rel="prettyPhoto[qdc023]" title="Portão Automático Basculante"></a> <a href="img/obras/qdc023-portao-automatico.jpg" data-rel="prettyPhoto[qdc023]" title="Portão Automático Basculante"><img src="img/obras/qdc023-portao-basculante.jpg" alt="Portão Automático Basculante" title="Portão Automático Basculante"></a></div><div class="item_description"><a href="javascript:{}"><span>Denyse Dias</span></a><br>Empresa com atendimento excelente, portão é maravilhoso!!! De todos os serviços e empresas contratadas para a reforma da casa a Quality Doors foi a que cumpriu com tudo que foi prometido.</div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc024-portoes-automaticos.jpg" data-rel="prettyPhoto[qdc024]" title="Portão Automático Basculante"><img src="img/obras/qdc024-portoes-automaticos.jpg" alt="Portões Automáticos" title="Portão Automático Basculante"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc025-portoes-automaticos.jpg" data-rel="prettyPhoto[qdc025]" title="Portão Automático Basculante"><img src="img/obras/qdc025-portoes-automaticos.jpg" alt="Portões Automáticos" title="Portão Automático Basculante"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc026-portoes-automaticos.jpg" data-rel="prettyPhoto[qdc026]" title="Portão Automático Basculante"><img src="img/obras/qdc026-portoes-automaticos.jpg" alt="Portões Automáticos" title="Portão Automático Basculante"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc027-portoes-automaticos.jpg" data-rel="prettyPhoto[qdc027]" title="Portão Automático Basculante"><img src="img/obras/qdc027-portoes-automaticos.jpg" alt="Portões Automáticos" title="Portão Automático Basculante"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc028-portoes-automaticos.jpg" data-rel="prettyPhoto[qdc028]" title="Portão Automático Basculante"><img src="img/obras/qdc028-portoes-automaticos.jpg" alt="Portões Automáticos" title="Portão Automático Basculante"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc029-portoes-automaticos.jpg" data-rel="prettyPhoto[qdc029]" title="Portão Automático Basculante"><img src="img/obras/qdc029-portoes-automaticos.jpg" alt="Portões Automáticos" title="Portão Automático Basculante"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc030-portoes-automaticos.jpg" data-rel="prettyPhoto[qdc030]" title="Portão Automático Basculante"><img src="img/obras/qdc030-portoes-automaticos.jpg" alt="Portões Automáticos" title="Portão Automático Basculante"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc031-portoes-automaticos.jpg" data-rel="prettyPhoto[qdc031]" title="Portão Automático Basculante"><img src="img/obras/qdc031-portoes-automaticos.jpg" alt="Portões Automáticos" title="Portão Automático Basculante"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc032-portoes-automaticos.jpg" data-rel="prettyPhoto[qdc032]" title="Portão Automático Basculante"><img src="img/obras/qdc032-portoes-automaticos.jpg" alt="Portões Automáticos" title="Portão Automático Basculante"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc033-portoes-automaticos.jpg" data-rel="prettyPhoto[qdc033]" title="Portão Automático Basculante"><img src="img/obras/qdc033-portoes-automaticos.jpg" alt="Portões Automáticos" title="Portão Automático Basculante"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc034-portoes-automaticos.jpg" data-rel="prettyPhoto[qdc034]" title="Foto de Portão Automático"><img src="img/obras/qdc034-portoes-automaticos.jpg" alt="Portões Automáticos" title="Foto de Portão Automático"></a></div></div><div class="span3 element semDepoimento" data-category="semDepoimento"><div class="hover_img"><a href="img/obras/qdc035-portoes-automaticos.jpg" data-rel="prettyPhoto[qdc035]" title="Foto de Portão Automático"><img src="img/obras/qdc035-portoes-automaticos.jpg" alt="Portões Automáticos" title="Foto de Portão Automático"></a></div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc001-portao-basculante-aberto.jpg" data-rel="prettyPhoto[qdc001]" title="Foto de Portão Automático"></a> <a href="img/obras/qdc001-portao-basculante.jpg" data-rel="prettyPhoto[qdc001]" title="Foto de Portão Automático"><img src="img/obras/qdc001-portao-basculante.jpg" alt="Portões Automáticos Automático" title="Foto de Portão Automático"></a></div><div class="item_description"><a href="javascript:{}"><span>Odilon Neto</span></a><br>Encontramos na Quality Doors exatamente o que esperávamos de uma empresa dedicada, análise criteriosa das nossas necessidades combinado com um atendimento personalizado, ágil e eficiente.</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc036-portoes-automaticos.jpg" data-rel="prettyPhoto[qdc036]" title="Foto de Portão Automático"><img src="img/obras/qdc036-portoes-automaticos.jpg" alt="Portões Automáticos Automático" title="Foto de Portão Automático"></a></div><div class="item_description"><a href="javascript:{}"><span>Benicio Francisco e Heliana.</span></a><br>A Quality Doors Portões é uma empresa que nos oferece um atendimento personalizado através de uma equipe competente. Seu show room permite conhecer o diferencial de seus produtos despertando a criatividade para elaborar um projeto que mais agrade o consumidor. Estamos muito satisfeitos com o portão adquirido que mostra a qualidade do serviço dessa empresa. Indicamos a Quality com toda segurança. Benicio e Heliana.</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc002-portao-basculante.jpg" data-rel="prettyPhoto[qdc002]" title="Foto de Portão Automático"></a> <a href="img/obras/qdc002-portao-basculante-fechado.jpg" data-rel="prettyPhoto[qdc002]" title="Foto de Portão Automático"></a> <a href="img/obras/qdc002-portao-basculante.jpg" data-rel="prettyPhoto[qdc002]" title="Foto de Portão Automático"><img src="img/obras/qdc002-portao-basculante.jpg" alt="Portões Automáticos Automático" title="Foto de Portão Automático"></a></div><div class="item_description"><a href="javascript:{}"><span>Diego P. Perri</span></a><br>A Quality Doors foi um dos poucos fornecedores de toda minha obra que superou minhas expectativas! Na realidade atual do país, com uma falta de mão de obra qualificada em tantos setores, e com tantos problemas de serviços nas empresas, a Quality Doors se mostrou extremamente profissional e com um ótimo atendimento e comprometimento quanto aos prazos e qualidade! Superou minhas expectativas, e fiquei realmente muito satisfeito!!</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc003-portao-basculante.jpg" data-rel="prettyPhoto[qdc003]" title="Foto de Portão Automático"><img src="img/obras/qdc003-portao-basculante.jpg" alt="Portões Automáticos" title="Foto de Portão Automático"></a></div><div class="item_description"><a href="javascript:{}"><span>Cristina Costanzi</span></a><br>Desde o primeiro meu primeiro contato a Quality Doors se mostrou comprometida em entender minha necessidade, realizando a entrega conforme o que decidi, no prazo e com a qualidade prometida.</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc004-portao-automatico-social.jpg" data-rel="prettyPhoto[pqdc004]" title="Foto de Portão Automático"><img src="img/obras/qdc004-portao-automatico-social.jpg" alt="Portões Automáticos e Portão Social" title="Foto de Portão Automático"></a></div><div class="item_description"><a href="javascript:{}"><span>Dayse Costa</span></a><br>A Quality doors me mostrou ser uma empresa séria desde o primeiro contato. O vendedor foi atencioso e cumpriu todo combinado. Recebi meu portão antes do prazo e tive toda assistência que precisei com rapidez e eficiência. Estou satisfeita com a minha escolha. A empresa está de parabéns pelos funcionários e pelos produtos que vendem.</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc005-portao-basculante.jpg" data-rel="prettyPhoto[qdc005]" title="Foto de Portão Automático"><img src="img/obras/qdc005-portao-basculante.jpg" alt="Portões Automáticos" title="Foto de Portão Automático"></a></div><div class="item_description"><a href="single_portfolio.html"><span>Maria de Renzo</span></a><br>Me declaro muito satisfeito com todo processo, desde a consulta ao site até o recebimento do produto. Tudo de elevado nível. Satisfeito sobretudo com a agilidade no atendimento e no prazo de recebimento do produto.</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc018-portao-basculante.jpg" data-rel="prettyPhoto[qdc018]" title="Foto de Portão Automático"><img src="img/obras/qdc018-portao-basculante.jpg" alt="Portões Automáticos" title="Foto de Portão Automático"></a></div><div class="item_description"><a href="javascript:{}"><span>Tomoko Nagami Murakami</span></a><br>Gostei muito do portão, a fachada da casa é estreita e o modelo foi ótimo para mim. A Quality Doors está de parabéns.</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc019-portao-basculante.jpg" data-rel="prettyPhoto[qdc019]" title="Foto de Portão Automático"><img src="img/obras/qdc019-portao-basculante.jpg" alt="Portões Automáticos" title="Foto de Portão Automático"></a></div><div class="item_description"><a href="javascript:{}"><span>Reinaldo Dal Piai</span></a><br>Trata-se de uma empresa idônea, sendo o portão eficiente e com tempo de abertura / fechamento menor que os portões tradicionais.</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc020-portao-basculante.jpg" data-rel="prettyPhoto[qdc020]" title="Foto de Portão Automático"><img src="img/obras/qdc020-portao-basculante.jpg" alt="Portões Automáticos" title="Foto de Portão Automático"></a></div><div class="item_description"><a href="javascript:{}"><span>Regina Vera Renda</span></a><br>Fiquei satisfeita com a qualidade do produto, dos serviços e do atendimento pós venda oferecido pela Quality Doors.</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc021-portao-basculante.jpg" data-rel="prettyPhoto[qdc021]" title="Foto de Portão Automático"><img src="img/obras/qdc021-portao-basculante.jpg" alt="Portões Automáticos" title="Foto de Portão Automático"></a></div><div class="item_description"><a href="javascript:{}"><span>Marli G. Taroleiro</span></a><br>Parabéns a equipe Quality Doors pelo excelente trabalho realizado em meu condomínio.</div></div><div class="span3 element comDepoimento" data-category="comDepoimento"><div class="hover_img"><a href="img/obras/qdc022-portao-basculante.jpg" data-rel="prettyPhoto[qdc022]" title="Foto de Portão Automático"><img src="img/obras/qdc022-portao-basculante.jpg" alt="Portões Automáticos" title="Foto de Portão Automático"></a></div><div class="item_description"><a href="javascript:{}"><span>Maria Angélica</span></a><br>Ótimo atendimento. O portão ficou de acordo com o solicitado. Obrigada a todos que tiveram envolvido nesse trabalho da Empresa Quality Doors.</div></div><div class="span3 element s